import React, { Component } from "react";
import UtenteDataService from "../services/tutorial.service";
import { Link } from "react-router-dom";

export default class Utentes extends Component {
  constructor(props) {
    super(props);
    this.onChangeSearchnome_utente = this.onChangeSearchnome_utente.bind(this);
    this.retrieveUtente = this.retrieveUtente.bind(this);
    this.refreshList = this.refreshList.bind(this);
    this.setActiveUtente = this.setActiveUtente.bind(this);
    this.removeAllUtente = this.removeAllUtente.bind(this);
    this.searchnome_utente = this.searchnome_utente.bind(this);

    this.state = {
      Utente: [],
      currentUtente: null,
      currentIndex: -1,
      searchnome_utente: ""
    };
  }

  componentDidMount() {
    this.retrieveUtente();
  }

  onChangeSearchnome_utente(e) {
    const searchnome_utente = e.target.value;

    this.setState({
      searchnome_utente: searchnome_utente
    });
  }

  retrieveUtente() {
    UtenteDataService.getAll()
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  refreshList() {
    this.retrieveUtente();
    this.setState({
      currentUtente: null,
      currentIndex: -1
    });
  }

  setActiveUtente(Utente, index) {
    this.setState({
      currentUtente: Utente,
      currentIndex: index
    });
  }

  removeAllUtente() {
    UtenteDataService.deleteAll()
      .then(response => {
        console.log(response.data);
        this.refreshList();
      })
      .catch(e => {
        console.log(e);
      });
  }

  searchnome_utente() {
    this.setState({
      currentUtente: null,
      currentIndex: -1
    });

    UtenteDataService.findBynome_utente(this.state.searchnome_utente)
      .then(response => {
        this.setState({
          Utente: response.data
        });
        console.log(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  }

  render() {
    const { searchnome_utente, Utente, currentUtente, currentIndex } = this.state;

    return (
      <div className="list row">
        <div className="col-md-8">
          <div className="input-group mb-3">
            <input
              type="text"
              className="form-control"
              placeholder="Procura por nome"
              value={searchnome_utente}
              onChange={this.onChangeSearchnome_utente}
            />
            <div className="input-group-append">
              <button
                className="btn btn-outline-secondary"
                type="button"
                onClick={this.searchnome_utente}
              >
                Procura
              </button>
            </div>
          </div>
        </div>
        <div className="col-md-6">
          <h4>Lista de Utentes</h4>

          <table class="table">
  <thead>
    <tr>
      <th scope="col">Número Sequencial</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody class="table-group-divider">
    <tr>
      <th scope="row">1</th>
      <td>{Utente.num_sequencial}</td>
      <td>{Utente.nome_utente}</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td colspan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>

          <ul className="list-group">
            {Utente &&
              Utente.map((Utente, index) => (
                <li
                  className={
                    "list-group-item " +
                    (index === currentIndex ? "active" : "")
                  }
                  onClick={() => this.setActiveUtente(Utente, index)}
                  key={index}
                >
                  {Utente.nome_utente} and {Utente.num_sequencial}
                </li>
              ))}
          </ul>

          <button
            className="m-3 btn btn-sm btn-danger"
            onClick={this.removeAllUtente}
          >
            Remove All
          </button>
        </div>
        <div className="col-md-6">
          {currentUtente ? (
            <div>
              <h4>Utente</h4>
              <div>
                <label>
                  <strong>Número Sequencial:</strong>
                </label>{" "}
                {currentUtente.num_sequencial}
              </div>
              <div>
                <label>
                  <strong>Nome:</strong>
                </label>{" "}
                {currentUtente.nome_utente}
              </div>
              <div>
                <label>
                  <strong>Sexo:</strong>
                </label>{" "}
                {currentUtente.sexo}
              </div>
              <div>
                <label>
                  <strong>Data de nascimento:</strong>
                </label>{" "}
                {currentUtente.data_nascimento}
              </div>

              <Link
                to={"/Utente/" + currentUtente.id}
                className="badge badge-warning"
              >
                Edit
              </Link>
            </div>
          ) : (
            <div>
              <br />
            </div>
          )}
        </div>
      </div>
    );
  }
}
